import React from "react";
import "./LeftMenu.css"

const LeftMenu = () => {
  return (
    <div className="left-menu">
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </div>
  );
};

export default LeftMenu;
